import React, { useState } from 'react';
import { BrowserRouter as Router, Route , Routes} from "react-router-dom";
import { Link } from "react-router-dom";

import "../style/projectselector.css";
import "../style/pageselector_options.css";

function CellMLPage () {

  return (
	  <body>
		  <div id="projects_header">
			<div>Personal Projects</div>
			<div class="bg"></div>
				<div class="star-field">
				<div class="layer"></div>
				<div class="layer"></div>
				<div class="layer"></div>
			</div>
		  </div>
		  <div id="container">
			<a className="animated zoomInLeft box red" href="/pokemondb/">Pok√©mon Database</a>
			<a className="animated zoomInRight box green" href="/page1/">CellML Editor</a>
			<a className="animated zoomInLeft box blue" href="/">Home</a>
		</div>
	  </body>
	
  );
}

export default CellMLPage;
